import styled from "styled-components";
const Pagination = (props) => {
  return (
    <PaginationWrapper>
      <ul>
        <li>
          <a>1</a>
        </li>
        <li>
          <a>2</a>
        </li>
        <li>
          <a>3</a>
        </li>
      </ul>
    </PaginationWrapper>
  );
};

export default Pagination;

const PaginationWrapper = styled.nav`
  /* display: flex; */
  justify-content: center;
`;
